import React, { useEffect, useState } from "react";
import { firebase } from "../firebase";

function useWeights() {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    firebase
      .firestore()
      .collection("users-weight")
      .onSnapshot((snapshot) => {
        const newUsers = snapshot.docs.map((doc) => ({
          id: doc.id,
          ...doc.data(),
        }));
        setUsers(newUsers);
      });
  }, []);
  return users;
}

